export const initialState = {
  mainPosts: [{
    id: 1,
    User: {
      id: 1,
      email: 'test@test.com',
      pass: 'test'
    },
    comment: 'test test test',
    Images: [
      {
        id: 1,
        url: "https://upload.wikimedia.org/wikipedia/commons/3/3b/Beef_curry_rice_003.jpg"
      },
      {
        id: 2,
        url: ""
      }
    ]
  }]
}

const reducer = (state = initialState, action) => {
  switch (action.type){
    default:
      return state;
  }
}

export default reducer;
